import { ICharacter } from "../../interfaces/ICharacter";

const SearchResults = ({
  characters,
  status,
  queryError,
  onDelete,
  onSelect,
}: any) => {
  return (
    <div>
      {status !== "ERROR"
        ? characters.map((c: ICharacter) => (
            <div key={parseInt(c.id, 10)}>
              <button onClick={onDelete}>X</button>
              <img src={c.image} alt={c.name} onClick={onSelect} />
            </div>
          ))
        : queryError}
    </div>
  );
};

export default SearchResults;
